const PlasmicDescendants = {
  root: [
    "root",
    "landingContainer",
    "section",
    "signupContainer",
    "emailAddress",
    "joinButton",
    "thanksForSigningUp",
    "signupContainer2",
    "emailAddress2",
    "joinButton2",
    "emailAddress22",
    "joinButton32"
  ],

  landingContainer: [
    "landingContainer",
    "section",
    "signupContainer",
    "emailAddress",
    "joinButton",
    "thanksForSigningUp",
    "signupContainer2",
    "emailAddress2",
    "joinButton2",
    "emailAddress22",
    "joinButton32"
  ],

  section: [
    "section",
    "signupContainer",
    "emailAddress",
    "joinButton",
    "thanksForSigningUp"
  ],

  signupContainer: ["signupContainer", "emailAddress", "joinButton"],
  emailAddress: ["emailAddress"],
  joinButton: ["joinButton"],
  thanksForSigningUp: ["thanksForSigningUp"],
  signupContainer2: ["signupContainer2", "emailAddress2", "joinButton2"],
  emailAddress2: ["emailAddress2"],
  joinButton2: ["joinButton2"],
  emailAddress22: ["emailAddress22"],
  joinButton32: ["joinButton32"]
} as const;
type NodeNameType = keyof typeof PlasmicDescendants;
type DescendantsType<
  T extends NodeNameType
> = typeof PlasmicDescendants[T][number];
type NodeDefaultElementType = {
  root: "div";
  landingContainer: "div";
  section: "section";
  signupContainer: "div";
  emailAddress: typeof LandingInput;
  joinButton: "button";
  thanksForSigningUp: "div";
  signupContainer2: "div";
  emailAddress2: typeof LandingInput;
  joinButton2: "button";
  emailAddress22: "input";
  joinButton32: "button";
};

type ReservedPropsType = "variants" | "args" | "overrides";
type NodeOverridesType<T extends NodeNameType> = Pick<
  PlasmicLanding__OverridesType,
  DescendantsType<T>
>;

type NodeComponentProps<T extends NodeNameType> =
  // Explicitly specify variants, args, and overrides as objects
  {
    variants?: PlasmicLanding__VariantsArgs;
    args?: PlasmicLanding__ArgsType;
    overrides?: NodeOverridesType<T>;
  } & // Specify variants directly as props
  Omit<PlasmicLanding__VariantsArgs, ReservedPropsType> &
    // Specify args directly as props
    Omit<PlasmicLanding__ArgsType, ReservedPropsType> &
    // Specify overrides for each element directly as props
    Omit<
      NodeOverridesType<T>,
      ReservedPropsType | VariantPropType | ArgPropType
    > &
    // Specify props for the root element
    Omit<
      Partial<React.ComponentProps<NodeDefaultElementType[T]>>,
      ReservedPropsType | VariantPropType | ArgPropType | DescendantsType<T>
    >;

function makeNodeComponent<NodeName extends NodeNameType>(nodeName: NodeName) {
  type PropsType = NodeComponentProps<NodeName>;
  const func = function <T extends PropsType>(
    props: T & StrictProps<T, PropsType>
  ) {
    const { variants, args, overrides } = deriveRenderOpts(props, {
      name: nodeName,
      descendantNames: [...PlasmicDescendants[nodeName]],
      internalArgPropNames: PlasmicLanding__ArgProps,
      internalVariantPropNames: PlasmicLanding__VariantProps
    });

    return PlasmicLanding__RenderFunc({
      variants,
      args,
      overrides,
      forNode: nodeName
    });
  };
  if (nodeName === "root") {
    func.displayName = "PlasmicLanding";
  } else {
    func.displayName = `PlasmicLanding.${nodeName}`;
  }
  return func;
}

export const PlasmicLanding = Object.assign(
  // Top-level PlasmicLanding renders the root element
  makeNodeComponent("root"),
  {
    // Helper components rendering sub-elements
    landingContainer: makeNodeComponent("landingContainer"),
    section: makeNodeComponent("section"),
    signupContainer: makeNodeComponent("signupContainer"),
    emailAddress: makeNodeComponent("emailAddress"),
    joinButton: makeNodeComponent("joinButton"),
    thanksForSigningUp: makeNodeComponent("thanksForSigningUp"),
    signupContainer2: makeNodeComponent("signupContainer2"),
    emailAddress2: makeNodeComponent("emailAddress2"),
    joinButton2: makeNodeComponent("joinButton2"),
    emailAddress22: makeNodeComponent("emailAddress22"),
    joinButton32: makeNodeComponent("joinButton32"),

    // Helper for creating a Renderer
    createRenderer: () => new PlasmicLanding__Renderer({}, {}),

    // Metadata about props expected for PlasmicLanding
    internalVariantProps: PlasmicLanding__VariantProps,
    internalArgProps: PlasmicLanding__ArgProps
  }
);

type ForNodeRenderer<NodeName extends NodeNameType> = NodeRenderer<
  PlasmicLanding__VariantsArgs,
  PlasmicLanding__ArgsType,
  NodeOverridesType<NodeName>
>;

class PlasmicLanding__Renderer extends Renderer<
  PlasmicLanding__VariantsArgs,
  PlasmicLanding__ArgsType,
  PlasmicLanding__OverridesType,
  "root"
> {
  constructor(
    variants: PlasmicLanding__VariantsArgs,
    args: PlasmicLanding__ArgsType
  ) {
    super(variants, args, PlasmicLanding__RenderFunc, "root");
  }

  protected create(
    variants: PlasmicLanding__VariantsArgs,
    args: PlasmicLanding__ArgsType
  ) {
    return new PlasmicLanding__Renderer(variants, args);
  }

  getInternalVariantProps(): VariantPropType[] {
    return PlasmicLanding__VariantProps;
  }

  getInternalArgProps(): ArgPropType[] {
    return PlasmicLanding__ArgProps;
  }

  forNode(name: "joinButton32"): ForNodeRenderer<"joinButton32">;
  forNode(name: "emailAddress22"): ForNodeRenderer<"emailAddress22">;
  forNode(name: "joinButton2"): ForNodeRenderer<"joinButton2">;
  forNode(name: "emailAddress2"): ForNodeRenderer<"emailAddress2">;
  forNode(name: "signupContainer2"): ForNodeRenderer<"signupContainer2">;
  forNode(name: "thanksForSigningUp"): ForNodeRenderer<"thanksForSigningUp">;
  forNode(name: "joinButton"): ForNodeRenderer<"joinButton">;
  forNode(name: "emailAddress"): ForNodeRenderer<"emailAddress">;
  forNode(name: "signupContainer"): ForNodeRenderer<"signupContainer">;
  forNode(name: "section"): ForNodeRenderer<"section">;
  forNode(name: "landingContainer"): ForNodeRenderer<"landingContainer">;
  forNode(name: "root"): ForNodeRenderer<"root">;
  forNode(name: NodeNameType) {
    return super.forNode(name);
  }
}

